import { Box, Button, TextField } from '@mui/material'
import React from 'react'

const Signup = () => {
    const handlesubmit =() => {};
  return (
    <form onSubmit={handlesubmit}>
        <Box>
            <TextField />
            <TextField />
            <TextField />
            <Button type='submit'>Signup</Button>
        </Box>
    </form>
  )
}

export default Signup
